CREATE TABLE `pager_data` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `data_type` int(11) NOT NULL DEFAULT '0' COMMENT 'Тип сообщения. 0-просто инфа, 1-выбор из списка, 2-ввод текста',
  `text_data` varchar(1450) NOT NULL DEFAULT '' COMMENT 'html текст',
  `quiz_caption` varchar(145) DEFAULT NULL COMMENT 'Это не null если есть опрос. Если не null и нет вариантов ответа, то ввод текста',
  `start_date` datetime NOT NULL COMMENT 'время начала публикации',
  `active` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'показываем или в архиве',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COMMENT='Новости и опросы для пейджера';
