DROP TABLE IF EXISTS `step`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `step` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `branch_id` bigint(20) NOT NULL COMMENT 'Филиал',
  `customer_id` bigint(20) NOT NULL COMMENT 'Клиент',
  `service_id` bigint(20) DEFAULT NULL COMMENT 'Оказываемая услуга клиенту',
  `employee_id` bigint(20) DEFAULT NULL COMMENT 'Этот сотрудник работал на этом шаге с клиентом',
  `before_step_id` bigint(20) DEFAULT NULL COMMENT 'Этот клиент впереди',
  `after_step_id` bigint(20) DEFAULT NULL COMMENT 'Этот клиент за ним',
  `stand_time` datetime DEFAULT NULL COMMENT 'Клиент начал ожидать вызова',
  `start_time` datetime DEFAULT NULL COMMENT 'Начали работать с клиентом',
  `finish_time` datetime DEFAULT NULL COMMENT 'Закончили работать с клиентом',
  `waiting` bigint(20) NOT NULL DEFAULT '0' COMMENT 'Время ожидания клиента на шаге в милисекундах',
  `working` bigint(20) NOT NULL DEFAULT '0' COMMENT 'Время работы с клиентом в милисекундах',
  `start_state` int(11) DEFAULT NULL COMMENT 'Шаг начался этим состоянием',
  `finish_state` int(11) DEFAULT NULL COMMENT 'Шаг завершился этим состоянием',
  PRIMARY KEY (`id`),
  KEY `idx_step_before_step_id` (`before_step_id`),
  KEY `idx_step_after_step_id` (`after_step_id`),
  CONSTRAINT `fk_step_after_step_id` FOREIGN KEY (`after_step_id`) REFERENCES `step` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_step_before_step_id` FOREIGN KEY (`before_step_id`) REFERENCES `step` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1884 DEFAULT CHARSET=utf8 COMMENT='Таблица отомарных обработак клиента';
/*!40101 SET character_set_client = @saved_cs_client */;

